import React, {Component} from 'react';

class LoginPage extends Component {
    constructor() {
        super();
        this.state = {
            email: '',
            password: ''
        }
    }

    onChange = (event) => {
        this.setState({[e.target.name]: e.target.value});
    }

    render() {
        return (
            <div>
                <input 
                    name='email'
                    placeholder='Email'
                    onChange={this.onChange}
                />
            </div>
        );
    }
}

export default LoginPage;
